import './App.css';

class App extends Component {

  constructor(){
    super();
    this.state = {
      monsters:[{
        name:'Linda'
      },
      {
        name:'Frank'
      },
      {
        name:'Julia'
      },
]

    }
  }

  render(){
    return (
      <div className="App">
        {
          this.state.monsters.map((monster) => {
            return <h1>{this.state.monsters.name}</h1>
          })
        }
      </div>
    );  
  }
}

export default App;
